import axios from "axios";
import { useState, useEffect } from "react";

const baseURL = "https://data.weather.gov.hk/weatherAPI/opendata/opendata.php?dataType=SRS&year=2021&rformat=json";

export default function SunriseSunset() {
  const [sunrise, setSunrise] = useState(null);

  // Get Request - SunriseSunset
  useEffect(() => {
    axios.get(baseURL).then((response) => {
        setSunrise(response.data);
      console.log(`effect`,response.data);
    });
  }, []);

    if (sunrise !== null && sunrise !== undefined) {
        return (
            sunrise.map((data, index) => {
                return(
                    <div className={index}>
                        <p>{data.place}</p>

                    </div>
                )
            })
        )} else { 
            return (<p>Problem Occurs</p>) }

}
